$			
\begin{array}{lllll}
e 
&= \sum\limits_{k=1}^{K}\sum\limits_{i=1 \atop x_i \in \mathcal{K}_k}^{N_{\mathcal{K}_k}}(x_i-\hat{m}_k)^2 	\\ \\

&=
\sum\limits_{i=1 \atop x_i \in \mathcal{K}_1}^{N_{\mathcal{K}_1}}
(x_i-\hat{m}_1)^2p_X(x_i) 	
+	
\sum\limits_{i=1 \atop x_i \in \mathcal{K}_2}^{N_{\mathcal{K}_2}}
(x_i-\hat{m}_2)^2p_X(x_i) 
+
\ldots 	
+	
\sum\limits_{i=1 \atop x_i \in \mathcal{K}_K}^{N_{\mathcal{K}_K}}
(x_i-\hat{m}_K)^2p_X(x_i)	\\ \\ \\ \\



\frac{\partial e}{\partial z_{\alpha, \beta}} 	
&=
\sum\limits_{i=1 \atop x_i \in \mathcal{K}_1}^{N_{\mathcal{K}_1}}
2(x_i-\hat{m}_1)\frac{\partial \hat{m}_1}{\partial z_{\alpha, \beta}}p_X(x_i)	
+ 
\sum\limits_{i=1 \atop x_i \in \mathcal{K}_2}^{N_{\mathcal{K}_2}}
2(x_i-\hat{m}_2)\frac{\partial \hat{m}_2}{\partial z_{\alpha, \beta}}p_X(x_i) 	
+ 
\ldots 	
+ 
\sum\limits_{i=1 \atop x_i \in \mathcal{K}_K}^{N_{\mathcal{K}_K}}
2(x_i-\hat{m}_K)\frac{\partial \hat{m}_K}{\partial z_{\alpha, \beta}}p_X(x_i)		\\ \\ \\ \\




&= 
\sum\limits_{k=1}^{K}\sum\limits_{i=1 \atop x_i \in (\mathcal{H}_{\alpha, \beta} \cap \mathcal{K}_k)}^{N_{\mathcal{H}_{\alpha, \beta} \cup \mathcal{K}_k}}
2(x_i-\hat{m}_k)\frac{\partial \hat{m}_k}{\partial z_{\alpha, \beta}}p_X(x_i)					\\ \\

&=
\sum\limits_{k=1}^{K}\sum\limits_{i=1 \atop x_i \in (\mathcal{H}_{\alpha, \beta} \cap \mathcal{K}_k)}^{N_{\mathcal{H}_{\alpha, \beta} \cap \mathcal{K}_k}}
2\left(x_i-\left[\sum\limits_{a=1 \atop a \neq \alpha}^A \hat{m}_{k,a} + z_{\alpha, \beta}\right]\right)\frac{\partial \left[\sum\limits_{a=1 \atop a \neq \alpha}^A \hat{m}_{k,a} + z_{\alpha, \beta}\right]}{\partial z_{\alpha, \beta}}p_X(x_i) 	\\ \\ \\ \\


\mbox{let } \frac{\partial e}{\partial z_{\alpha, \beta}} 				&=0		\\ \\


\Rightarrow z_{\alpha,\beta}	&=	\frac{\sum\limits_{k=1}^{K}\sum\limits_{i=1 \atop x_i \in (\mathcal{H}_{\alpha, \beta} \cap \mathcal{K}_k)}^{N_{\mathcal{H}_{\alpha, \beta} \cap \mathcal{K}_k}}\left(x_i-\left[\sum\limits_{a=1 \atop a \neq \alpha}^A \hat{m}_{k,a} + z_{\alpha, \beta}\right]\right)p_X(x_i)}{\sum\limits_{k=1}^{K}\sum\limits_{i=1 \atop x_i \in (\mathcal{H}_{\alpha, \beta} \cap \mathcal{K}_k)}^{N_{\mathcal{H}_{\alpha, \beta} \cap \mathcal{K}_k}}p_X(x_i)}
\end{array}
$
